import axios from "axios";

const API_URL = "http://127.0.0.1:5000"; // Your backend URL

export const fetchAdjustedPrices = async () => {
  console.log("fetchAdjustedPrices is being called"); // Debugging log
  const response = await axios.post(`${API_URL}/adjust-prices`);
  return response.data; // Return fetched data
};
